tables.table_schema:
CREATE TABLE quantum_algorithms (
  id INT,
  name VARCHAR(255),
  description TEXT,
  created_at TIMESTAMP
);

CREATE TABLE QuantumAlgorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(255),
    algorithm_description TEXT
);

CREATE TABLE quantum_algorithms (
    algorithm_id INT PRIMARY KEY,
    algorithm_name VARCHAR(50) NOT NULL,
    description TEXT,
    optimization_level INT
);

CREATE TABLE quantum_circuits (
    circuit_id INT PRIMARY KEY,
    circuit_name VARCHAR(50) NOT NULL,
    gate_count INT,
    qubit_count INT
);

CREATE TABLE algorithm_circuit_mapping (
    mapping_id INT PRIMARY KEY,
    algorithm_id INT REFERENCES quantum_algorithms(algorithm_id),
    circuit_id INT REFERENCES quantum_circuits(circuit_id)
);

CREATE TABLE optimization_history (
    history_id INT PRIMARY KEY,
    algorithm_id INT REFERENCES quantum_algorithms(algorithm_id),
    optimization_steps INT,
    optimization_time TIMESTAMP
);
